import React, { useEffect } from "react";
import axios from "axios";
import { useState } from "react";

const Users = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:3001/user").then((res) => {
      setData(res.data);
    });
  }, []);
  console.log(data);

  return (
    <div>
      <h1>All Users</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Age</th>
            <th>Address</th>
            <th>Salary</th>
            <th>Department</th>
            <th>Marital Status</th>
          </tr>
        </thead>
        <tbody>
          {data.map((user) => {
            <>
              <tr>{user.Name}</tr>
              <tr>{user.Age}</tr>
              <tr>{user.Address}</tr>
              <tr>{user.Salary}</tr>
              <tr>{user.Department}</tr>
              <tr> {user.maritalState}</tr>
            </>;
          })}
        </tbody>
      </table>
    </div>
  );
};

export default Users;
